/* Form to create an user. */

import { lg_api, addInvalidRegister } from "../../__modules__";
import React from "react";

class CreateUser extends React.Component {
  constructor() {
    super();
    this.state = { new_user: [] };

    // Methods
    this.handleInput = this.handleInput.bind(this);
    this.submitUser = this.submitUser.bind(this);
  }

  /**
   * Handle all inputs.
   * @param {event} e
   */
  handleInput(e) {
    this.setState({ profile_data: e.target.value });
  }

  /**
   * Handle the submit event and send received data.
   * @param {event} e
   */
  async submitUser(e) {
    e.preventDefault();
    let form_user = new FormData();

    // Data
    let username = document.querySelector("#id_username").value;
    let email = document.querySelector("#id_email").value;
    let first_name = document.querySelector("#id_first_name").value;
    let last_name = document.querySelector("#id_last_name").value;
    let biography = document.querySelector("#id_biography").value;
    let picture = document.querySelector('input[type="file"]').files[0];

    // Username validation
    if (username !== undefined) {
      form_user.append("username", username);
    }

    // Email validation
    if (email !== undefined) {
      form_user.append("email", email);
    }

    // First name validation
    if (first_name !== undefined) {
      form_user.append("first_name", first_name);
    }

    // Last name validation
    if (last_name !== undefined) {
      form_user.append("last_name", last_name);
    }

    // Biography validation
    if (biography !== undefined) {
      form_user.append("biography", biography);
    }

    // Picture validation
    if (picture !== undefined) {
      form_user.append("picture", picture);
    }

    await lg_api("accounts/users/", {
      method: "post",
      headers: {
        "Content-Type": "multipart/form-data",
      },
      data: form_user,
    })
      .then((res) => {
        console.log(res);
        window.location.hash = "#profile";
      })
      .catch((err) => {
        addInvalidRegister();
      });
  }

  render() {
    return (
      <form
        method="post"
        encType="multipart/form-data"
        onSubmit={(e) => {
          this.submitUser(e);
        }}
      >
        <div className="mx-auto mt-4 w-75">
          {/* Title create profile */}
          <div className="mb-2 col-sm-8 mx-auto">
            <h2 className="h2">Create your account</h2>
          </div>

          {/* Username */}
          <div className="mb-2 col-sm-8 mx-auto">
            <label htmlFor="id_username" className="form-label">
              Username:
            </label>
            <input
              type="text"
              placeholder="Username"
              id="id_username"
              className="form-control"
              required
              onChange={(e) => {
                this.handleInput(e);
              }}
            />
          </div>

          {/* Password */}
          <div className="mb-2 col-sm-8 mx-auto">
            <label htmlFor="id_password" className="form-label">
              Password:
            </label>
            <input
              type="password"
              placeholder="Password"
              id="id_password"
              className="form-control"
              required
              onChange={(e) => {
                this.handleInput(e);
              }}
            />
          </div>

          {/* Email */}
          <div className="mb-2 col-sm-8 mx-auto">
            <label htmlFor="id_email" className="form-label">
              Email:
            </label>
            <input
              type="text"
              className="form-control"
              pattern=".+@gmail\.com"
              maxLength="170"
              minLength="8"
              id="id_email"
              placeholder="youremail@domain.com"
              aria-label="Your email"
              required
              onChange={(e) => {
                this.handleInput(e);
              }}
            />
          </div>

          {/* First name */}
          <div className="mb-2 col-sm-8 mx-auto">
            <label htmlFor="id_first_name" className="form-label">
              First name:
            </label>
            <input
              type="text"
              placeholder="First name"
              id="id_first_name"
              className="form-control"
              onChange={(e) => {
                this.handleInput(e);
              }}
            />
          </div>

          {/* Last name */}
          <div className="mb-2 col-sm-8 mx-auto">
            <label htmlFor="id_last_name" className="form-label">
              Last name:
            </label>
            <input
              type="text"
              placeholder="Last name"
              id="id_last_name"
              className="form-control"
              onChange={(e) => {
                this.handleInput(e);
              }}
            />
          </div>

          {/* Biography */}
          <div className="mb-2 col-sm-8 mx-auto">
            <label htmlFor="id_biography" className="form-label">
              Biography:
            </label>
            <input
              type="text"
              placeholder="Your biography"
              id="id_biography"
              className="form-control"
              onChange={(e) => {
                this.handleInput(e);
              }}
            />
          </div>

          {/* Picture */}
          <div className="mb-2 col-sm-8 mx-auto">
            <label htmlFor="id_picture" className="form-label">
              Picture:
            </label>
            <input
              type="file"
              id="id_picture"
              accept="image/png, image/jpeg"
              className="form-control"
              onChange={(e) => {
                this.handleInput(e);
              }}
            />
          </div>

          {/* Submit */}
          <div className="d-grid gap-2 col-sm-8 mx-auto mb-2">
            <button type="submit" className="btn btn-primary">
              Register now!
            </button>
          </div>
        </div>
      </form>
    );
  }
}

export { CreateUser };
